import React from 'react'
import {BrowserRouter} from 'react-router-dom'
import {DataProvider} from './GlobalState'

function App() {
  return (
    <DataProvider>
    <div className="App">
      <h1 className="text-6xl text-red-500" >Hello</h1>
    </div>
    </DataProvider>
  );
}

export default App;
